    "2016-07-27T22:19:56.868138",nt"name": "eastern-shore-of-virginia-and-fisherman-island-national-wildlife-refuges-comprehensive-con",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Eastern Shore of Virginia and Fisherman Island
    NWRs for the next 15 years. This plan outlines the refuges' vision and purpose and
    describes how Eastern Shore of Virginia and Fisherman Island NWRs will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the refuges, an overview of the CCP process, a summary of refuge resources, and
    information about the management direction. Key planning issues include: boat ramp,
    fire arms range, communications tower, contaminants, land acquisition, habitat management,
    invasive plant species, Fisherman Island, hunting, beach access, and cultural resources.",nt"license_title":
